	<script>
        function validateForm() {
            var x = document.forms["sbm"]["nopes"].value;
            var p = x.substring(0, 3);
            if ((x.length !== 12) || (p !== "120")) {
                setTimeout(function () { swal("Invalid!","Periksa kembali penulisan Nomor Pendaftaran!\n\nKetentuan:\n- Jumlah digit 12\n- Diawali 120","error")}, 1000);
                return false;
            }
        }
